&quot;Galveston&quot; is the title of a 1969 song written by Jimmy Webb and popularized by Glen Campbell.

The song is sung by a soldier in combat who is nostalgic for his home town, Galveston, Texas, characterized as a woman: &quot;I still see her standing by the water ... Standing there, looking out to sea, and is she waiting there for me...&quot;

The song was somewhat controversial in some circles, as its subject, singing while cleaning his gun, admits to being &quot;so afraid of dying&quot;.

Webb admitted in interviews that he didn't have the Vietnam War in mind when he wrote the song, as he imagined it taking place during a battle of the Spanish-American War, the time period when the City of Galveston reached its civic peak. However, it was widely perceived as a protest song, which is also underlined in the original promo video as Campbell is dressed up in a military outfit.

This song made the CMT list of the ten greatest country-western songs of all time. The popular crossover single also made #4 on the Billboard Hot 100, and #1 on the country music and &quot;Easy Listening&quot; charts.



